@@ -1,5 +1,83 @@
 .body {
   &-right {
-    
+    		&-container {
+			&-heading {
+				display: block;
+				padding: 0 100px 30px 0;
+				display: flex;
+				justify-content: flex-start;
+				align-items: flex-start;
+				flex-direction: column;
+				border-bottom: 1px solid $textBlack;
+				margin-bottom: 30px;
+				color: $textBlack;
+				span:first-child {
+					font-size: 16px;
+				}
+				span:last-child {
+					font-size: 30px;
+					font-weight: 500;
+				}
+			}
+		}
+		.products {
+			&-heading {
+				display: flex;
+				justify-content: space-between;
+				align-items: center;
+				margin-bottom: 20px;
+				span {
+					font-size: 13px;
+					position: relative;
+					select {
+						padding: 8px 20px;
+						font-size: 14px;
+						border: 1px solid $textGray;
+						border-radius: 4px;
+						&:focus {
+							outline: none;
+						}
+						-moz-appearance: none;
+						-webkit-appearance: none;
+						appearance: none;
+						option {
+							font-size: 14px;
+						}
+						background-color: transparent;
+					}
+					&:last-child {
+						&::after {
+							content: '\25bc';
+							position: absolute;
+							top: 0;
+							right: 0;
+							width: 34px;
+							height: 34px;
+							background-color: transparent;
+							display: flex;
+							justify-content: center;
+							align-items: center;
+							font-size: 15px;
+							z-index: -1;
+							color: $textGray;
+						}
+						&:hover {
+							&::after {
+								color: $textBlue;
+							}
+						}
+					}
+				}
+			}
+			&-list {
+				display: flex;
+				justify-content: center;
+				align-items: center;
+				flex-wrap: wrap;
+				.product-item {
+					width: 25%;
+				}
+			}
+		}
   }
 }
